renderHTML:
__ht__function(data, gv, cache) {if (!cache.htmlView) {
    const div = cache.htmlView = document.createElement('div');
        div.style.overflow = 'hidden';
        div.style.width = '100%';
        div.style.height = '100%';
        div.setAttribute('class', 'svg-box');
        data.div = div;
        div.layoutHTML = function() {
            gv.layoutHTML(data, div);
        };
}

const svgStyle = document.getElementById('svg_component_style');
if (!svgStyle) {
    const sty = document.createElement('style');
    const str = ".svg-box svg{width:100%;height:100%;}";
    sty.type = "text/css";
    sty.id = "svg_component_style";
    if (sty.styleSheet) { // 兼容IE
        sty.styleSheet.cssText = str;
    } else {
        sty.innerHTML = str;
    }
    document.getElementsByTagName("head")[0].appendChild(sty)
}
cache.htmlView.innerHTML = data.a('content');
cache.htmlView.style.background = data.a('background');
return cache.htmlView;}
